import styled from 'styled-components';

export const Container = styled.div`
  display: grid;
  justify-content: center;
  align-items: center;
  float: right;
  margin-top: -45%;
  margin-right: 10%;
  width: 65%;
  height: 60%;
`;

export const Title = styled.h1`
  width: 600px;
  margin-left: 60%;
  margin-top: 15%;
  font-size: 70px;
  color: #3ecbb0;
`;

export const Text = styled.p`
  margin-left: 55%;
  padding-left: 3%;
  width: 60%;
  font-size: 25px;
  color: black;
`;
